import React from 'react'

function Singlegroupentry({click}) {
  return (
    <div className='single-group'
    onClick={click}

    >
    <p>
        JavaScript Forum
    </p>
    <p>
        2:30 pm
    </p>

    </div>
  )
}

export default Singlegroupentry
